import React from "react";
import * as Rb from "react-bootstrap";
import "./style.scss";
import Fb from "../../../assets/fb.png";
import Tl from "../../../assets/tl.png";
import Tw from "../../../assets/tw.png";
import Yt from "../../../assets/yt.png";
import Dc from "../../../assets/dc.png";

const Team = () => {
  return (
    <section className="blockable_contact--wrapper">
      <Rb.Container>
        <Rb.Col lg={12} sm={12} className="blockable_contact-title">
          <h2>Contact Us</h2>
          <p>
            Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do
            eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim
            ad minim veniam
          </p>
          <Rb.Button variant="outline-light" className="disclaimer">
            Disclaimer
          </Rb.Button>
        </Rb.Col>

        <Rb.Row>
          <Rb.Col md={6} lg={6} xl={6} className="m-auto contact-group">
            <Rb.Button variant="outline-light">
              <img src={Fb} alt="contact" />
            </Rb.Button>
            <Rb.Button variant="outline-light">
              <img src={Tl} alt="contact" />
            </Rb.Button>
            <Rb.Button variant="outline-light">
              <img src={Tw} alt="contact" />
            </Rb.Button>
            <Rb.Button variant="outline-light">
              <img src={Yt} alt="contact" />
            </Rb.Button>
            <Rb.Button variant="outline-light">
              <img src={Lc} alt="contact" />
            </Rb.Button>
          </Rb.Col>
        </Rb.Row>
      </Rb.Container>
    </section>
  );
};

export default Team;
